import React, { useState } from "react";
import CompanyProspectList from "./companyprospect";
import MapProspects from "./MapProspect";

export default function App() {
  const [companyName, setCompanyName] = useState("");
  const [postalCode, setPostalCode] = useState("");
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [view, setView] = useState('list'); // ‚¨ÖÔ∏è AJOUTE LE STATE VIEW

  const mapCompanyData = (rawData = []) => (rawData || []).map((c, i) => ({
    id: i,
    name: c.nom || c.nom_entreprise || "Inconnu",
    address: c.adresse || c.adresse_siege || "",
    sector: c.secteur || c.libelle_naf || "",
    resume: c.resume || "",
    site: c.site_web || c.site || "",
    telephone: c.telephone || "",
    contacts: c.contacts || [],
    sources: c.sources || [],
    latitude: c.latitude || c.lat || null,
    longitude: c.longitude || c.lng || null,
    ville: c.ville || "",
    code_postal: c.code_postal || "",
    adresse: c.adresse || "",
    naf: c.naf || "",
    siren: c.siren || `temp-${i}`
  }));

  async function handleSearch(e) {
    if (e && e.preventDefault) e.preventDefault();
    console.debug("Lancement recherche:", { companyName, postalCode });
    setError(null);
    if (!companyName || !postalCode) {
      setError("Nom et code postal requis");
      return;
    }
    setLoading(true);
    setData([]);
    try {
      const res = await fetch("http://localhost:5000/prospect", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ companyName, location: postalCode })
      });

      const text = await res.text().catch(() => "");
      console.debug("R√©ponse HTTP:", res.status, "Content-Type:", res.headers.get("content-type"));
      console.debug("Corps brut (d√©but):", (text || "").slice(0, 1000));

      let js = null;
      try {
        js = text ? JSON.parse(text) : null;
      } catch (parseErr) {
        console.error("Impossible de parser le JSON:", parseErr);
        setError(`R√©ponse inattendue du serveur (status ${res.status}). Voir console pour le corps brut.`);
        setLoading(false);
        return;
      }

      if (!res.ok) {
        setError(js?.error || `Erreur serveur (${res.status})`);
        setLoading(false);
        return;
      }

      const mapped = mapCompanyData(js.data || []);
      console.debug("Donn√©es mapp√©es:", mapped.length, mapped.slice(0, 2));
      setData(mapped);
    } catch (err) {
      console.error("handleSearch erreur:", err);
      setError(err.message || "Erreur r√©seau");
    } finally {
      setLoading(false);
    }
  }

  return (
    <div>
      {/* ‚¨ÖÔ∏è MENU DE NAVIGATION */}
      <div style={{ 
        display: 'flex', 
        gap: '16px', 
        padding: '16px', 
        background: '#f8f9fa', 
        borderBottom: '1px solid #ddd' 
      }}>
        <button 
          onClick={() => setView('list')}
          style={{ 
            padding: '10px 20px', 
            background: view === 'list' ? '#1a73e8' : '#fff',
            color: view === 'list' ? '#fff' : '#000',
            border: '1px solid #ddd',
            borderRadius: '8px',
            cursor: 'pointer',
            fontWeight: '500'
          }}
        >
          üìã Liste
        </button>
        <button 
          onClick={() => setView('map')}
          style={{ 
            padding: '10px 20px', 
            background: view === 'map' ? '#1a73e8' : '#fff',
            color: view === 'map' ? '#fff' : '#000',
            border: '1px solid #ddd',
            borderRadius: '8px',
            cursor: 'pointer',
            fontWeight: '500'
          }}
        >
          üó∫Ô∏è Carte
        </button>
      </div>

      {/* ‚¨ÖÔ∏è VUE LISTE */}
      {view === 'list' && (
        <div style={{ padding: 16, fontFamily: "Arial, sans-serif" }}>
          <h2>üéØ Prospection</h2>
          <form onSubmit={handleSearch} style={{ marginBottom: 12 }}>
            <input
              placeholder="Nom entreprise (ex: Castorama)"
              value={companyName}
              onChange={(e) => setCompanyName(e.target.value)}
              style={{ marginRight: 8, padding: '8px 12px' }}
            />
            <input
              placeholder="Code postal (ex: 75015)"
              value={postalCode}
              onChange={(e) => setPostalCode(e.target.value)}
              style={{ marginRight: 8, width: 110, padding: '8px 12px' }}
            />
            <button type="submit" disabled={loading}>
              {loading ? "Recherche..." : "üîç Rechercher"}
            </button>
          </form>

          {error && <div style={{ color: "crimson", marginBottom: 8 }}>‚ùå {error}</div>}

          <CompanyProspectList data={data} />
        </div>
      )}

      {/* ‚¨ÖÔ∏è VUE CARTE */}
      {view === 'map' && (
        <MapProspects
          data={data}
          center={{ lat: 48.8566, lng: 2.3522 }}
        />
      )}
    </div>
  ); // ‚¨ÖÔ∏è UNE SEULE FERMETURE ICI
}
